import React from 'react';
import './Education.css';
const Education = () => {
    return (
        <div className="education">
        <h3 className="h4tag">Education Details</h3>
        <h5 className="h5tag">Bachelor's-JNTU</h5>
        <h6 className="h6tag">Information of Technology-2011</h6>
        <h5 className="h5tag">Master's in computer Science</h5>
        <h6 className="h6tag"> Northwestern Polytechnic University-2015</h6>
        <h5 className="h5tag">Master's in information systems security</h5>
        <h6 className="h6tag">University of the cumberlands Inprogress</h6>

        </div>
    )}

export default Education;
